import React from 'react'
import PropTypes from 'prop-types'
import FormControl from '@material-ui/core/FormControl';
import InputLabel from '@material-ui/core/InputLabel';
import Input from '@material-ui/core/Input';
import Button from '@material-ui/core/Button';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';

const QuoteCar = ({handleFormChange,onQuoteCar,quoteCar}) => {
    return (
        <>
            <FormControl>
              <InputLabel htmlFor="brand">Marca del coche</InputLabel>
              <Input id="brand" onChange={handleFormChange}/>
            </FormControl>
            <FormControl>
              <InputLabel htmlFor="year2">Año del coche</InputLabel>
              <Input id="year2" onChange={handleFormChange}/>
            </FormControl>
            <FormControl>
              <InputLabel htmlFor="ac">¿AC?</InputLabel>
              <Input id="ac" onChange={handleFormChange}/>
            </FormControl>
            <FormControl>
              <Button variant="contained" color="primary" onClick = {() => "" } >
                 Buscar
            </Button>
            </FormControl>
            <Table>
                <TableHead>
                    <TableRow>
                    <TableCell padding="default">CoverageType</TableCell>
                    <TableCell padding="default">Id</TableCell>
                    <TableCell align="default">Brand</TableCell>
                    <TableCell align="default">Company</TableCell>
                    <TableCell align="default">Price</TableCell>
                    <TableCell align="default">Extra Coverage Price</TableCell>
                    <TableCell align="default">Year Range</TableCell>
                    </TableRow>
                </TableHead>
                <TableBody>
                    {
                        quoteCar.length
                    }
                </TableBody>
             </Table>
           
        </>
    )
}

QuoteCar.propTypes = {

}

export default QuoteCar
